Certain programs can be installed by using the following structure in your configuration.nix file: programs = { # Programs go here
}; Only a few programs can be installed this way - these programs can be found here by using the NixOS options search feature, or by using the nix repl: nix repl '<nixpkgs/nixos>'
nix-repl> builtins.attrNames config.programs Note Using this method for installing programs is desirable if possible compared to method 2, as this normally sets the required environment variables for the program to function properly. In addition, various configuration options are available (e.g. adding shell aliases to the fish shell) Of course, this is only an option if the specific program you want exists in the programs attribute.

