Using nix search is the easiest way to find packages for your current version of NixOS. Simply type nix search <packageName> to search for a specific package $ nix search google chrome
* nixpkgs.google-chrome (google-chrome) A freeware web browser developed by Google * nixpkgs.google-chrome-beta (google-chrome-beta) A freeware web browser developed by Google * nixpkgs.google-chrome-dev (google-chrome-dev) A freeware web browser developed by Google * nixpkgs.python37Packages.PyChromecast (python3.7-PyChromecast) Library for Python 3.4+ to communicate with the Google Chromecast To use a package from the nix search command, you must include the package name after nixpkgs , not the name in brackets . This is due to various package 'flavours' being packaged under a single package name. For example: environment.systemPackages = with pkgs; [ google-chrome gnome3.gnome-mahjongg
];

