This method gives you much more control over what specific version of Nixpkgs you want to use on your system, however it means that updating channels (if you choose to do so) will also have to be done manually. The only difference is that you require the following code structure: import (builtins.fetchGit { name = "NAME"; url = https://github.com/nixos/nixpkgs/; rev = "REV";
}) {}; The NAME is some sort of descriptive name for your own benefit, and the REV refers to the Git commit hash of your choosing (This is pretty easy to find on GitHub, it's shown as a 7-character string on the Nixpkgs repository's commits - clicking on the clipboard icon next to it copies the full hash to your clipboard) An example of using this would be as follows: { config, pkgs, ... }: let myNixpkgs = import (builtins.fetchGit { name = "nixos-unstable-2018-09-12"; url = https://github.com/nixos/nixpkgs/; rev = "ca2ba44cab47767c8127d1c8633e2b581644eb8f"; }) {};
in { # The rest of your configuration here environment.systemPackages = with pkgs; [ # Exactly the same as the above example myNixpkgs.hello ];
}; Alternatively, you can easily change all packages declared in the system packages to use your chosen git revision by changing the packages that are brought into scope after the with keyword: environment.systemPackages = with myNixpkgs; [ hello
];

