By adding the --pure tag to the nix-shell command, you are able to create an environment which contains none of the packages installed on your current system. For example, if you have the following in your configuration.nix file: environment.systemPackages = with pkgs; [ hello
]; Running the hello command in a pure nix shell that doesn't have the hello package will produce the following result: $ nix-shell --pure -p [nix-shell:~]$ hello
The program 'hello' is currently not installed. It is provided by several packages. You can install it by typing one of the following: nix-env -iA nixos.hello nix-env -iA nixos.mbedtls nix-env -iA nixos.perkeep

