As with any programming language, there are the basic data types, which are as follows: Strings - Text values which are encased in quotes "hello" , or two single quotes for multi-line strings: '' This is on line 1 This is another line
'' If you want to use Nix variables inside your strings, you can do so using the ${} notation, like this [2] : someSet = rec { myVar = "hello"; someString = "${myVar}, world!"
} See the section below for recursive sets - since we reference myVar in the declaration of someString , the set needs to be declared as recursive. Integers & Floats - Numerical values, such as 2 or 501.23 . Integer and floating point numbers are inferred. If using math with integers, integer division will be used by default. Paths - Paths to files and directories don't need quotes, they can be written just like /some/directory/file.txt Functions - These basically execute code. These will not be covered in NixOS4Noobs. Lists & Sets - These are explained in more detail below

