The system packages section of the configuration file is represented as a list: environment.systemPackages = [ hello chromium
]; It can also be written like this (Typically a space is put after the [ and before the ] , but this is optional): environment.systemPackages = [ hello chromium ]; Complex elements which would involve spaces require brackets to "contain" them: environment.systemPackages = [ hello (import ./someLocalPackage.nix {}) chromium
];

