Because sets contain elements of keys and values, where values can be of any type, there's nothing stopping you from declaring a set with an element which is also a set. mySet = { myKey = { someValueInInnerSet = 10; };
} This can get tedious and overcomplicated, so we can simplify this using the dot notation: mySet.myKey = { someValueInInnerSet = 10;
} Or even simpler: mySet.myKey.someValueInInnerSet = 10; Example: Enabling sound in the system configuration In most configurations, enabling sound is done using the following code: sound.enable = true; This can be written as: sound = { enable = true;
} There's no preference to which one is right and which one is wrong, it's entirely up to you. Some people like to split them up to make sections easier to read.

61.body:
Sets that use variables or values that are declared inside itself need to be declared as a recursive set. This is done using the rec keyword, which comes just before the opening curly brackets: someSet = rec { someValue = 2; someOtherValue = 2 + someValue;
} This also applies for anything used in Strings using the ${} notation: someSet = rec { myVar = "hello"; someString = "${myVar}, world!"
}

